export default (function(a,b,c,d,e,f,g,h){return {data:{CbdnUqb8dP:{data:{id:2084,attributes:{imdbId:"tt0119893",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTUwMjYzMzU3Nl5BMl5BanBnXkFtZTcwMzcwNzUyMQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"82%"}],item_lang:{data:{id:2747,attributes:{title:a,plot:"Photographer Charles Castle is numbed with grief following the death of his beautiful bride. He goes off to war, working in the trenches as a photographer. Following the war and still in grief, Charles is given some photographs purporting to be of fairies. His search for the truth leads him to Burkinwell, a seemingly peaceful village seething with secrets where he becomes drawn into a web of passion, romance, and violence.",slug:"photographing-fairies"}}},books:{data:[{id:10369,attributes:{title:a,description:c,thumbnail:d,authors:[b],firstBook:true,published:e,publisher:f,subtitle:g}},{id:10370,attributes:{title:a,description:c,thumbnail:d,authors:[b],firstBook:h,published:e,publisher:f,subtitle:g}},{id:10371,attributes:{title:a,description:"In the 1920s, a country policeman, Constable Michael Walsmear, punches his way into the London studio of Charles Castle, the world-famous American photographer, to show him some pictures. What Castle sees in Walsmear's pictures is incredible. When he goes to Sir Arthur Conan Doyle for verification of the faerie images found on the negatives, Doyle tries to bribe Castle to destroy the pictures. But Castle will not be bought; he is out to discover the truth. And truth he finds in the small village of Burkinwell, a village built upon secrets, strange sexual practices, beautiful gardens, and true human nature.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6JlxswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:h,published:"2003-02-01",publisher:"E-Rights\u002FE-Reads Limited",subtitle:""}}]}}},meta:{}}},prerenderedAt:1680940943091}}("Photographing Fairies","Steve Szilagyi","In 1920s England, an American photographer is out to capture proof that fairies are real—despite the opposition of Sir Arthur Conan Doyle. In the 1920s, a country policeman, Constable Michael Walsmear, pushes his way into the London studio of Charles Castle, the world‐famous American photographer, to show him some pictures. What Castle sees in Walsmear’s pictures is incredible. When he goes to Sir Arthur Conan Doyle for verification of the faerie images found on the negatives, Doyle tries to bribe Castle to destroy the pictures. But Castle will not be bought; he is out to discover the truth. And it is truth he finds in the small village of Burkinwell, a village built upon secrets, strange sexual practices, beautiful gardens, and true human nature.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dmiaAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-05-27","Open Road Media","A Novel",null))